es_322',NULL,'TU_322 (bound polymerase count)','Bound polymerase count','MG_452 - MG_453',0),(13814,15,'rnaBoundRNAPolymerases_323',NULL,'TU_323 (bound polymerase count)','Bound polymerase count','MG_454',0),(13815,15,'rnaBoundRNAPolymerases_324',NULL,'TU_324 (bound polymerase count)','Bound polymerase count','MG_455',0),(13816,15,'rnaBoundRNAPolymerases_325',NULL,'TU_325 (bound polymerase count)','Bound polymerase count','MG_456',0),(13817,15,'rnaBoundRNAPolymerases_326',NULL,'TU_326 (bound polymerase count)','Bound polymerase count','MG_457',0),(13818,15,'rnaBoundRNAPolymerases_327',NULL,'TU_327 (bound polymerase count)','Bound polymerase count','MG_458',0),(13819,15,'rnaBoundRNAPolymerases_328',NULL,'TU_328 (bound polymerase count)','Bound polymerase count','MG_459',0),(13820,15,'rnaBoundRNAPolymerases_329',NULL,'TU_329 (bound polymerase count)','Bound polymerase count','MG_460',0),(13821,15,'rnaBoundRNAPolymerases_330',NULL,'TU_330 (bound polymerase count)','Bound polymerase count','MG_461 - MG_462',0),(13822,15,'rnaBoundRNAPolymerases_331',NULL,'TU_331 (bound polymerase count)','Bound polymerase count','MG_463 - MG_465',0),(13823,15,'rnaBoundRNAPolymerases_332',NULL,'TU_332 (bound polymerase count)','Bound polymerase count','MG_466',0),(13824,15,'rnaBoundRNAPolymerases_333',NULL,'TU_333 (bound polymerase count)','Bound polymerase count','MG_467 - MG_468',0),(13825,15,'rnaBoundRNAPolymerases_334',NULL,'TU_334 (bound polymerase count)','Bound polymerase count','MG_526',0),(13827,13,'visualization','RNAExpressionMapVisualization','Mature RNA expression','','<p>This visualization displays the mature copy number of each RNA transcript over the cell cycle. Each colored rectangle represents an individual transcription unit. Mouse over each transcription unit to see its name and a brief description. Click each transcription unit to obtain a detailed description at <a href=\"http://wholecellkb.stanford.edu\">WholeCellKB</a>.</p>\r\n\r\n<p>The copy number of each transcript has been normalized to its maximal expression over the cell cycle. High expression is colored yellow. Low expression is colored blue.</p>\r\n\r\n',1),(13828,17,'visualization','DnaAVisualization','Replication initiation &ndash; oriC DnaA Boxes','','29 DnaA molecules are believed to segregate the chromosome strands and thereby initiate DNA replication by cooperatively binding to five (R1-5) high affinity sites near the oriC. This visualization represents the DnaA occupancy of the R1-5 sites.',1),(13829,12,'translationVisualization','TranslationVisualization','Translation','','This visualization depicts the length of the longest polypeptide of each protein-coding gene. Protein-coding genes with one active ribosome are colored blue. Genes with multiple active ribosomes are colored green.',1),(13830,8,'energyHeatmap','EnergyHeatmapVisualization','Process Energy Usage','','This visualization displays a heatmap of the energy usage of each of the 28 modeled cellular processes over time. High energy usage is colored green, low energy usage is colored red.',0),(13831,7,'metabolicMapVisualization','MetabolicMapVisualization','Metabolism','','This visualization depicts the fluxes of several metabolic reactions (green indicates high flux, red indicates low flux) and the concentrations of several metabolites (node size). ',1),(13832,2,'chromosomeCircleVisualization','ChromosomeCircleVisualization','DNA replication, protein occupancy, methylation, &amp; damage','','This visualization displays the polymerization (blue), protein DNA binding (green),  methylation (orange), and strand break (red) status of the <i>M. genitalium</i> chromosomes. Mother DNA is colored dark blue. Daughter DNA is colored light blue.',1),(13833,2,'chromosomeSpaceTimeVisualization','ChromosomeSpaceTimeVisualization','DNA replication','','This visualization is a space-time plot of the replication initiation (green) and replication machinery (blue).',1),(13834,13,'geneExpressionHeatmapVisualization','GeneExpressionHeatmapVisualization','Gene expression','','This visualization displays the expression of every RNA and protein gene product. High expression is colored yellow; low expression is colored blue.',1),(13835,10,'ProteinMonomerExpressionMapVisualization','ProteinMonomerExpressionMapVisualization','Mature protein monomer expression','','<p>This visualization displays the mature copy number of each protein monomer over the cell cycle. Each colored rectangle represents an individual protein monomer. Mouse over each protein monomer to see its name and a brief description. Click each protein monomer to obtain a detailed description at <a href=\"http://wholecellkb.stanford.edu\">WholeCellKB</a>.</p>\r\n\r\n<p>The copy number of each protein has been normalized to its maximal expression over the cell cycle. High expression is colored yellow. Low expression is colored blue.</p>\r\n\r\n',1),(13836,13,'NascentRNAExpressionMapVisualization','NascentRNAExpressionMapVisualization','Nascent RNA expression','','<p>This visualization displays the nascent copy number of each RNA transcript over the cell cycle. Each colored rectangle represents an individual transcription unit. Mouse over each transcription unit to see its name and a brief description. Click each transcription unit to obtain a detailed description at <a href=\"http://wholecellkb.stanford.edu\">WholeCellKB</a>.</p>\r\n\r\n<p>The copy number of each transcript has been normalized to its maximal expression over the cell cycle. High expression is colored yellow. Low expression is colored blue.</p>\r\n\r\n',1),(13837,10,'NascentProteinMonomerExpressionMapVisualization','NascentProteinMonomerExpressionMapVisualization','Nascent protein monomer expression','','<p>This visualization displays the nascent copy number of each protein monomer over the cell cycle. Each colored rectangle represents an individual protein monomer. Mouse over each protein monomer to see its name and a brief description. Click each protein monomer to obtain a detailed description at <a href=\"http://wholecellkb.stanford.edu\">WholeCellKB</a>.</p>\r\n\r\n<p>The copy number of each protein has been normalized to its maximal expression over the cell cycle. High expression is colored yellow. Low expression is colored blue.</p>\r\n\r\n',1),(13838,4,'CellShapeVisualization3D','CellShapeVisualization3D','Cell shape','','This animation displays the predicted shape of <i>M. genitalium</i> over its life cycle.',1),(13839,4,'CellShapeVisualization3DIntro','CellShapeVisualization3DIntro','Cell shape','','This animation displays the predicted shape of <i>M. genitalium</i> over its life cycle.',1);
