INSERT INTO `classes` VALUES (1,'Summary','Summary','Represents summary datasets'),(2,'Chromosome','Chromosome','Chromosomes encode the structure and function of every RNA and protein, and thereby control cellular behavior. This class represents the polymerization, winding, modification, protein occupancy, and (de)catentation status of the chromosome(s). The reconstructed M. genitalium chromosome contains 525 genes (580078 nt) organized into 335 transcription units.'),(3,'FtsZRing','FtsZ Ring','M. genitalium contains a protein called FtsZ that assembles into long filaments, bound to the membrane at the midline of the cell, which are implicated in cell pinching. This class represents the configuration of the FtsZ septal ring. During cytokinesis, the FtsZ ring iteratively shrinks until the membrane is separated and division is complete.'),(4,'Geometry','Geometry','Represents cell shape and volume'),(5,'Host','Host','Represents four properties of the host human urogenital epithelium'),(6,'Mass','Mass',''),(7,'MetabolicReaction','Metabolic Reactions','Represents the predicted flux of each metabolic reaction'),(8,'Metabolite','Metabolite','Represents the copy number of each metabolite'),(9,'ProteinComplex','Protein Complexes','Represents the copy number of each macromolecular complex'),(10,'ProteinMonomer','Protein Monomers','Represents the copy number of each protein monomer'),(11,'RNAPolymerase','RNA Polymerases','Represents the configuration of each RNA polymerase'),(12,'Ribosome','Ribosomes','Represents the configuration of each ribosome'),(13,'Rna','RNA','Represents the copy number of each RNA transcript'),(15,'Transcript','Transcription','Represents the configuration of the chromosome (i.e. polymerization, protein occupancy, and modification status)'),(14,'Stimulus','Stimulus','Represents external termperature, radiation, and the status of three common experimental stress conditions'),(17,'DnaA','DnaA','');
/*!40000 ALTER TABLE `classes` ENABLE KEYS */;
UNLOCK TABLES;

